('''00788''','ASSAULT 4TH DEGREE DATING VIOLENCE (MINOR INJURY)','''508.030''','A','Misdemeanor','https://apps.legislature.ky.gov/law/statutes/statute.aspx?id=19730','Domestic Violence','A relationship between individuals who have, or have had, a relationship of a romantic or intimate nature. It does not include a casual acquaintanceship or ordinary fraternization in a business or social context.
The following factors may be considered, in addition to any other relevant factors, in determining whether the relationship is, or was, of a romantic or intimate nature:
  Declarations of romantic interest;
  The relationship was characterized by the expectation of affection;
  Attendance at social outings together as a couple;
  The frequency and type of interaction between the persons, including whether the persons have been involved together over time and on a continuous basis during the course of the relationship; and
 Other indications of a substantial connection that would lead a reasonable person to understand that a dating relationship existed.
','YES',FALSE,'','','YES','YES'),
